import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import '../styles.css';
import { withTheme } from '@material-ui/core';
import { height } from '@material-ui/system';
//import axios from 'axios';
//import { isLoginAdmin,isLogin,isLoginClient } from './Accueil';

class Navbar extends Component {


    refreshNavBar=()=> {
        window.location.reload(false)
     }

    render(){
        return (
            <nav className="navbar navbar-default" id='navbar' style={{
                height:80
            }}>
                <div className="container-fluid">
                    <div className="navbar-header">

                        <NavLink to="/" className="navbar-brand"  style={{fontSize:22, marginTop:10,
                                color:'black',fontWeight:'bold',marginLeft:10}}>TECH SUPPORT</NavLink>

                    </div>
                    <div className="collapse navbar-collapse" 
                        id="bs-example-navbar-collapse-1">
                        <ul className="nav navbar-nav navbar-right ul" style={{ marginTop:10}} >

                            <li className="li_nav" activeClassName="main-nav">
                                <NavLink exact to="/">Accueil</NavLink>
                            </li>
                            <li className="li_nav" activeClassName="main-nav">
                                <NavLink to="/Tickets">Tickets</NavLink>
                            </li>
                            <li className="li_nav" activeClassName="main-nav">
                                <NavLink to="/Staff">Administration</NavLink>
                            </li>
                            <li className="li_nav" activeClassName="main-nav">
                                <NavLink to="/Services">Services</NavLink>
                            </li>
                            <button onClick={this.deconnexion} style={{border:'none',borderRadius:20,marginRight:5,backgroundColor:"gray"}} >
                                <a className="navbar-brand" style={{fontSize:14,
                                    color:'white',fontWeight:'bold',margin:"auto"}}>S'abonner</a>
                            </button>
                            <button onClick={this.deconnexion} style={{border:'none',borderRadius:20,backgroundColor:"#80D0D0"}} >
                                <a className="navbar-brand" style={{fontSize:14,
                                    color:"white",fontWeight:'bold',margin:"auto"}}>Connexion</a>
                            </button>
                        </ul>
                    </div>
                </div>
            </nav>
        );
    }
}

export default Navbar
